import React from 'react';
import {useState,useEffect} from 'react';

function App() {

  const [user,setUser] = useState([]);


  // useEffect(() => {
  //   getFetch();
  // },[user])


  const getFetch = () => {
   try {
    const data = "http://localhost:8080/sign/all";
    fetch(data)
      .then(result => {
        const posts = result.json();
        return posts.map(post => {
          return(
            <li>{post}</li>
          )
        })
      })
      .catch(err => console.log(err));
   } catch (error) {
      console.log(error);
   }
  }


  return (
    <div>
      {getFetch()}
    </div>
  )
}

export default App
